Das schöne 2-Familienhaus mit 3 Garagen und Wintergarten, Hanglage mit unverbaubarer, herrlicher Aussicht über den See liegt 25 km südlich von Brissago in Ghiffa, Italien und direkt an einem Naturschutzgebiet.

Das Gebäude, BJ 1967, wurde in den letzten Jahren komplett und sorgfältig renoviert, mit Anbau eines Wintergartens.

Räumlichkeiten: EG: 3 Garagen, Hobbyraum, Keller, Gasheizungsraum;

1. Stock: Wohnzimmer mit Warmluft-Cheminee, 2 Schlafzimmer, Küche, Bad, schöner Wintergarten, grosser Terrasse mit Aussenkamin und Pizzaofen;

2. Stock: Gästeappartement im Dachgeschoss, mit separatem Eingang, Wohnzimmer, 2 Schlafzimmer, Küche, Bad;

1.270 m2 Garten, terrassiert, sehr gepflegt und eingezäunt, mit Gartenhaus, Treibhaus und Unterstand; Gemüsegarten, Obstgarten (Kiwi, Kaki, Äpfel, Birnen, Zwetschgen, Kirschen und Reben)

Bushaltestelle 150 m entfernt.

Das Haus eignet sich als Ferienhaus oder als Wohnsitz und war die letzten Jahren bewohnt. Es wird altershalber verkauft. 

Für eine detaillierte Dokumentation nehmen sie bitte mit mir Kontakt auf.

A Camorino, frazione Vigana, facilmente raggiungibile ma lontano da traffico e confusione, proponiamo in affitto un appartamento di 4,5 locali ristrutturato
con bellissima vista sul piano di Magadino e sul lago. 
Lappartamento fa parte di un piccolo complesso di sole 3 unità abitative, è posto al 1° ed ultimo piano ed è così composto: 
* Ingresso con armadiatura a muro; 
* Cucina abitabile con angolo breakfast; 
* Grande soggiorno con camino angolare e uscita sul terrazzo con vista aperta; 
* 3 ampie e luminose camere di cui 2 con balcone; 
* 2 bagni (1 con vasca ergonomica ed 1 con ampia doccia); 
* Lavatrice-asciugatrice uso privato al piano -1, locale comune. 
* Grande giardino in uso esclusivo, recintato, con barbecue in cemento; 
* Due posti auto esterni scoperti; 
* Cantina

Lunità è stata recentemente ristrutturata, i pavimenti sono in ceramica (camere in parquet), riscaldamento a nafta con serpentine, serramenti in legno in ottimo stato con doppi vetri. 
Animali ammessi 
No lift

Vigana è una piccola località, posta sulle prime alture circostanti di Camorino, a prevalente destinazione residenziale ed agricola. Vi si trovano principalmente abitazioni monofamiliari, costruite nel rispetto della natura circostante che offre diverse opportunità di relax. 

