Non hai tempo per un corso di inglese?
A partire da oggi puoi seguire delle lezioni di inglese quando e dove vuoi tu, anche online mentre sei comodamente sdraiato sul divano di casa tua!
Sono disponibile quando sei libero tu, anche la sera tardi o molto presto la mattina. 

Le lezioni sono disponibili per tutti i livelli e sono studiate su misura in base al tuo livello e alle tue necessità:
 Preparazione agli esami Cambridge, IELTS, First Certificate (FCE), Cambridge Advanced (CAE), Proficiency (CPE), TOEFL etc.;
 Conversazione;
 Lezione di pronuncia;
 Lezioni divertenti di grammatica (ebbene si, la grammatica non deve essere sempre noiosa);
 Business English;
 Medical English;
 Preparazione per colloqui in inglese;
 Correzione di articoli, tesi ecc.;
 Supporto durante tutto lanno scolastico.

Le lezioni costano solo CHF 45.-/ora.

